CREATE TABLE `sample_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `owner_id` int(11) NOT NULL,
  `contact_id` int(11) NOT NULL,
  `contract_id` int(10) unsigned NOT NULL,
  `inquiry_order_id` int(11) NOT NULL,
  `name` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `duration` int(11) NOT NULL,
  `cover_picture_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `style_no` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `category_id` int(11) NOT NULL,
  `product_weight` double(8,2) NOT NULL,
  `production_no` int(11) NOT NULL,
  `production_duration` int(11) NOT NULL,
  `production_price` decimal(10,2) NOT NULL,
  `submit_count` smallint(6) NOT NULL,
  `note` varchar(500) COLLATE utf8_unicode_ci NOT NULL,
  `status` enum('PENDING_PAY','IN_PROGRESS','SUBMITTED','FINISHED','EXPIRED','NOT_PASSED') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'PENDING_PAY',
  `extra` text COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `sample_order_records`;
CREATE TABLE `sample_order_records` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sample_order_id` int(11) NOT NULL,
  `track_name` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `track_number` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `owner_note` varchar(500) COLLATE utf8_unicode_ci NOT NULL,
  `contact_note` varchar(500) COLLATE utf8_unicode_ci NOT NULL,
  `production_price` int(11) NOT NULL,
  `production_duration` int(11) NOT NULL,
  `status` enum('PENDING_CONFIRM','SATISFIED','DISSATISFIED') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'PENDING_CONFIRM',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `confirmed_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `services`;
CREATE TABLE `services` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL,
  `category_id` int(11) NOT NULL DEFAULT '0',
  `custom_category` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `type` enum('SAMPLE','PRODUCTION','CUSTOM') COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `en_name` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL,
  `en_content` text COLLATE utf8_unicode_ci NOT NULL,
  `attachment_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `cover_picture_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `duration` int(11) DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `en_description` text COLLATE utf8_unicode_ci NOT NULL,
  `need_delivery` tinyint(1) DEFAULT NULL,
  `is_free` tinyint(1) DEFAULT NULL,
  `price` decimal(10,2) NOT NULL,
  `status` enum('ACTIVE','INACTIVE') COLLATE utf8_unicode_ci DEFAULT 'ACTIVE',
  `visit_count` int(11) NOT NULL,
  `weight` int(10) unsigned NOT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `category_tag` enum('SERIES','SINGLE') COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `services_user_id_index` (`user_id`),
  KEY `services_category_id_index` (`category_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='设计师自定义服务列表';


DROP TABLE IF EXISTS `service_orders`;
CREATE TABLE `service_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `owner_id` int(11) NOT NULL,
  `contact_id` int(11) NOT NULL,
  `contract_id` int(10) unsigned NOT NULL,
