  `amount` decimal(10,2) NOT NULL,
  `service_type` enum('SPRING_SUMMER','FALL_WINTER') COLLATE utf8_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` enum('PENDING_PAY','PAID','ACCEPTED','DRAFT_SUBMITTED','CONFIRMED','SUBMITTED','FINISHED','CONTACT_CANCELED','OWNER_CANCELED','EXPIRED') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'PENDING_PAY',
  `extra` text COLLATE utf8_unicode_ci,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `service_order_items`;
CREATE TABLE `service_order_items` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
