  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `transactions`;
CREATE TABLE `transactions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `transactionable_id` int(11) NOT NULL,
  `transactionable_type` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `reference_id` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_id` int(10) DEFAULT NULL,
  `amount` decimal(10,2) NOT NULL,
  `note` tinytext COLLATE utf8_unicode_ci,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `pay_type` enum('ALIPAY','DEFARA','PAYPAL') COLLATE utf8_unicode_ci DEFAULT NULL,
  `pay_account` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `type` enum('SERVICE','RECHARGE','WITHDRAW','SAMPLE','PRODUCTION','REFUND') COLLATE utf8_unicode_ci DEFAULT NULL,
  `source` enum('amount','privilege') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'amount',
  PRIMARY KEY (`id`),
  KEY `transactions_user_id_index` (`user_id`),
  KEY `transactions_reference_id_index` (`reference_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` enum('DESIGNER','MAKER','CUSTOMER','DEALER') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'CUSTOMER',
  `cellphone` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  `avatar` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `first_name` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` enum('MALE','FEMALE','SECRET') COLLATE utf8_unicode_ci DEFAULT 'SECRET',
  `find_password` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_email_verified` tinyint(1) DEFAULT '0',
  `is_cellphone_verified` tinyint(1) DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `find_password_at` timestamp NULL DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT '0.00',
  `remember_token` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` enum('ACTIVE','INACTIVE') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'ACTIVE',
  `nickname` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `birthday` timestamp NULL DEFAULT NULL,
  `privilege_amount` double(8,2) NOT NULL,
  `verify_content` text COLLATE utf8_unicode_ci NOT NULL,
  `is_verify` tinyint(1) NOT NULL DEFAULT '0',
  `logged_at` timestamp NULL DEFAULT NULL,
  `account_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `weight` int(10) unsigned NOT NULL,
  `extra` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `user_addresses`;
CREATE TABLE `user_addresses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
