  `city_region_id` int(10) NOT NULL,
  `province_region_id` int(10) NOT NULL,
  `country_region_id` int(10) NOT NULL,
  `country_ISO` char(3) COLLATE utf8_unicode_ci DEFAULT NULL,
  `postcode` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_default` tinyint(1) DEFAULT '0',
  `note` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `user_addresses_user_id_index` (`user_id`),
  KEY `user_addresses_city_region_id_index` (`city_region_id`),
  KEY `user_addresses_province_region_id_index` (`province_region_id`),
  KEY `user_addresses_country_region_id_index` (`country_region_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


