(51,	78,	'assets/profile/2016/02/03/89b70d8a4a75f7512a0885a0c665e92a5dfe45b6.jpg',	'男女同款中性风黑色圆领100%美利奴羊毛衫',	379.00,	27,	0,	NULL,	0.00,	0.00,	'我们选用澳大利亚进口美利奴羊毛。美利奴绵羊是世界上最古老的绵羊品种之一，与其他生长在低地上的绵羊不同，美利奴生活在澳大利亚的极端环境中——普通绵羊无法在这样的环境中生存。美利奴羊毛是极少数能够真正地对抗各种苛刻环境的纺织原料，100%美利奴羊毛织物则是其中的极致臻品。',	7,	NULL,	'2016-02-01 03:24:33',	'2016-02-03 10:12:46',	NULL,	'ACTIVE',	0,	'',	'',	'',	'',	'R2820303103700',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'assets/profile/2016/02/01/4a6308c7386ddb0b0b267e8e0a8419bcf376c06b.jpg',	'',	'Black Unisex O-Neck 100% Merino Wool Sweater',	'We import Merino from Australia. The merino is one of the world’s most ancient breeds of sheep. Very different to a regular sheep who chews grass in the lowlands, merino live in the extremes of Australia. Regular sheep would freeze to death up there. Therefore, the merino’s fleece is absolutely built for extremes.',	'DEFARA Original',	'{\"brand_description\":\"\\u8fd9\\u662fDEFARA\\u65d7\\u4e0b\\u7684\\u539f\\u521b\\u65f6\\u5c1a\\u54c1\\u724c\\u3002\\u6211\\u4eec\\u4ece\\u4e16\\u754c\\u5404\\u5730\\u8d2d\\u4e70\\u4e00\\u6d41\\u7684\\u539f\\u521b\\u8bbe\\u8ba1\\u7a3f\\uff0c\\u5e76\\u59d4\\u6258DEFARA\\u8ba4\\u8bc1\\u5236\\u9020\\u5546\\u8fdb\\u884c\\u751f\\u4ea7\\u5236\\u9020\\uff1b\\u540c\\u65f6\\u53bb\\u9664\\u4e0d\\u5fc5\\u8981\\u7684\\u4e2d\\u95f4\\u73af\\u8282\\uff0c\\u529b\\u6c42\\u4e3a\\u5168\\u7403\\u6d88\\u8d39\\u8005\\u5e26\\u6765\\u66f4\\u4f18\\u8d28\\u3001\\u66f4\\u4f4e\\u4ef7\\u7684\\u65f6\\u5c1a\\u8bbe\\u8ba1\\u4ea7\\u54c1\\u3002\",\"en_brand_description\":\"This is an emerging fashion label created by DEFARA. We buy top-class design works from worldwide fashion designers, and authorize DEFARA Transparent Makers to manufacture. By cutting off unnecessary middlemen, we bring better quality products with lower costs to consumers.\"}',	'0.3KG',	'{\"texture\":\"100%\\u6fb3\\u6d32\\u8fdb\\u53e3\\u7f8e\\u5229\\u5974\\u7f8a\\u6bdb\",\"en_texture\":\"100% Merino Wool\"}',	'{\"washing\":\"\\u4e0d\\u53ef\\u6c34\\u