(1,	'',	'<div align=\"center\">设计服务购买合同<br></div><br><blockquote>买方（以下简称甲方）：:owner_name<span class=\"text-danger\"></span></blockquote><blockquote>设计师（以下简称乙方）：:contact_name<span class=\"text-danger\"></span></blockquote><br><blockquote>甲乙双方在DEFARA缝纫侠网站根据平等自愿的原则，购买乙方所提供的设计服务，特订立以下协议；<br></blockquote><blockquote>一、设计服务描述<br></blockquote>设计服务名称：:name<br>作品所属季节：:type_label<br>参考图片：:attachments<span class=\"text-danger\"></span><br>设计服务描述：<br>数量：1<br>订单总额：:amount<br>:description<br><blockquote>二、合同建立<br></blockquote>1.甲方在缝纫侠网站上选择适合的设计师及设计服务后，填写设计服务所需内容，并同意本协议条款后，24小时之内付款至缝纫侠网站。<br>2.乙方在收到甲方订单后，可根据订单描述及乙方自身安排，选择是否接受订单，若接受订单，则合同建立；若不接受订单，则缝纫侠自动退款给甲方，合作取消。<br>3.若乙方在3个自然日内没有对订单进行操作，则自动退款至甲方，合作终止。<br><blockquote>三、设计服务交付及验收<br></blockquote>1.乙方在接受订单后，根据甲方需求描述，设计草图，并以附件形式提交至缝纫侠。<br>2.甲方在收到设计草图后，应该在3个自然日内确认草图，或者在IM即时聊天工具上提出修改，乙方应根据修改内容对设计草图做出对应修改。<br>3.若甲方在3个自然日内没有对订单进行操作，则自动确认设计草图，乙方开始进行Teck Pack的设计。<br>4.在确认设计草图后，订单不能被取消，但可以修改，甲方需将修改信息通过即时聊天工具发送给乙方，直至修改完成。<br>5.乙方完成Teck Pack后，应根据缝纫侠提供的模板对Teck Pack信息进行完善，以符合甲方的需求。<br>6、若甲方对Teck Pack有修改意见，则乙方应该尽可能满足甲方修改需求。<br>7.在乙方提交Teck Pack后，若甲方在3个自然日内没有进行确认操作，则自动付款至乙方账号，交易完成。<br>8.若乙方在服务描述中表明可提供布样建议，纸片，或者样衣，则应该按照设计服务描述中内容将相关实物通过物流方式递送至甲方所在地，递送费用应包含在设计服务订单总额里面。<br><blockquote>四、所有权<br></blockquote>1.在甲方未确认设计草稿前，所有权归乙方所有；在甲方已确认草稿后，所有权归甲方所有；<br>2.所有权转移后，乙方承诺不得再将此订单中涉及的草稿、纸样、Teck Pack等相关资料或实物进行二次销售或转卖。并不得将订单内容透露给除缝纫侠和甲方外的任何第三方。<br><blockquote>五、风险承担<br></blockquote>若订单中涉及实物交付，在乙方按合同要求将实物送至指定的交付地点之前，货物丢失风险由乙方承担；货物送到指定地点之后，丢失风险和物理损环均由甲方自行承担。<br><blockquote>六、违约责任<br></blockquote>订单结束后，若甲方在其他任何第三方平台、网站、报刊、媒体等发现和订单内容相关的资料或实物的展示或售卖，有权向乙方请求赔偿。<br><blockquote>七、纠纷解决<br></blockquote>如履行本合同时发生争议，双方应本着首先友好协商解决的原则。如协商不成则交由甲方所在地法院诉讼解决。',	'<div align=\"center\">设计服务购买合同(english)<br></div><br><blockquote>买方（以下简称甲方）：:owner_name<span class=\"text-danger\"></span></blockquote><blockquote>设计师（以下简称乙方）：:contact_name<span class=\"text-danger\"></span></blockquote><br><blockquote>甲乙双方在DEFARA缝纫侠网站根据平等自愿的原则，购买乙方所提供的设计服务，特订立以下协议；<br></blockquote><blockquote>一、设计服务描述<br>