escription</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\">数量：1&nbsp;</span></font></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">订单总额：:amount</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s2\"><i><font size=\"3\">:description</font></i></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\"><span style=\"font-weight: 700;\">二、合同建立</span></font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.甲方在缝纫侠网站上选择适合的设计师及设计服务后，填写设计服务所需内容，并同意本协议条款后，24小时之内付款至缝纫侠网站。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2.乙方在收到甲方订单后，可根据订单描述及乙方自身安排，选择是否接受订单，若接受订单，则合同建立；若不接受订单，则缝纫侠自动退款给甲方，合作取消。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">3.若乙方在3个自然日内没有对订单进行操作，则自动退款至甲方，合作终止。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">三、设计服务交付及验收</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.乙方在接受订单后，根据甲方需求描述，设计草图，并以附件形式提交至缝纫侠。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2.甲方在收到设计草图后，应该在3个自然日内确认草图，或者在IM即时聊天工具上提出修改，乙方应根据修改内容对设计草图做出对应修改。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">3.若甲方在3个自然日内没有对订单进行操作，则自动确认设计草图，乙方开始进行技术包（Teck Pack）的设计。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">4.在确认设计草图后，订单不能被取消，但可以修改，甲方需将修改信息通过即时聊天工具发送给乙方，直至修改完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">5.乙方完成Teck Pack后，应根据缝纫侠提供的模板对Teck Pack信息进行完善，以符合甲方的需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">6、若甲方对Teck Pack有修改意见，则乙方应该尽可能满足甲方修改需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">7.在乙方提交Teck Pack后，若甲方在3个自然日内没有进行确认操作，则自动付款至乙方账号，交易完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">8.若乙方在服务描述中表明可提供布样建议，纸片，或者样衣，则应该按照设计服务描述中内容将相关实物通过物流方式递送至甲方所在地，递送费用应包含在设计服务订单总额里面。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; 