e: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2.甲方在收到设计草图后，应该在3个自然日内确认草图，或者在IM即时聊天工具上提出修改，乙方应根据修改内容对设计草图做出对应修改。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">3.若甲方在3个自然日内没有对订单进行操作，则自动确认设计草图，乙方开始进行技术包（Teck Pack）的设计。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">4.在确认设计草图后，订单不能被取消，但可以修改，甲方需将修改信息通过即时聊天工具发送给乙方，直至修改完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">5.乙方完成Teck Pack后，应根据缝纫侠提供的模板对Teck Pack信息进行完善，以符合甲方的需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">6、若甲方对Teck Pack有修改意见，则乙方应该尽可能满足甲方修改需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">7.在乙方提交Teck Pack后，若甲方在3个自然日内没有进行确认操作，则自动付款至乙方账号，交易完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">8.若乙方在服务描述中表明可提供布样建议，纸片，或者样衣，则应该按照设计服务描述中内容将相关实物通过物流方式递送至甲方所在地，递送费用应包含在设计服务订单总额里面。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">四、所有权及相关权利</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.在甲方未确认设计草稿前，所有权归乙方所有；在甲方已确认草稿后，所有权归甲方所有；</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2. 所有权转移后，乙方承诺不得再将此订单中涉及的草稿、纸样、Teck Pack等相关资料或实物进行二次销售或转卖。并不得将订单内容透露给除缝纫侠和甲方外的任何第三方。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">五、风险承担</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">若订单中涉及实物交付，在乙方按合同要求将实物送至指定的交付地点之前，货物丢失风险由乙方承担；货物送到指定地点之后，丢失风险和物理损坏均由甲方自行承担。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">六、违约责任</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">订单结束后，若甲方在其他任何第三方平台、网站、报刊、媒体等发现和订单内容相关的资料或实物的展示或售卖，有权向乙方请求赔偿。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">七、纠纷解决</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">如履行本合同时发生争议，双方