(11,	'',	'<div align=\"center\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"p1\" style=\"line-height: 29.4px;\" align=\"center\"><span class=\"s1\"><span style=\"font-weight: 700;\"><font size=\"5\">设计服务购买合同</font></span></span></p><p class=\"p2\" style=\"line-height: 29.4px;\"><font size=\"3\"><span class=\"s1\"></span><br></font></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\"><span style=\"line-height: 22.4px;\">&nbsp; &nbsp; &nbsp;&nbsp; </span>买方（以下简称甲方）：<i>:owner_name</i></span></font></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\"><span style=\"line-height: 22.4px;\">&nbsp; &nbsp; &nbsp;&nbsp; </span>设计师（以下简称乙方）：<i>:contact_name</i></span></font></p><p class=\"p4\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"font-size: medium; line-height: 1.4;\"><br></span></p><p class=\"p4\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"font-size: medium; line-height: 1.4;\">&nbsp; &nbsp; &nbsp; &nbsp;甲乙双方在DEFARA缝纫侠网站根据平等自愿的原则，购买乙方所提供的设计服务，特订立以下协议；</span><br></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\"><span style=\"font-weight: 700;\">一、设计服务描述</span></font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">设计服务名称：:name</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">作品所属季节：:service_type</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\">参考图片：<i>:attachments</i></span></font></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">设计服务描述：:service_description</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\">数量：1&nbsp;</span></font></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">订单总额：:amount</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s2\"><i><font size=\"3\">:description</font></i></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\"><span style=\"font-weight: 700;\">二、合同建立</span></font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.甲方在缝纫侠网站上选择适合的设计师及设计服务后，填写设计服务所需内容，并同意本协议条款后，24小时之内付款至缝纫侠网站。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2.乙方在收到甲方订单后，可根据订单描述及乙方自身安排，选择是否接受订单，若接受订单，则合同建立；若不接受订单，则缝纫侠自动退款给甲方，合作取消。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">3.若乙方在3个自然日内没有对订单进行操作，则自动退款至甲方，合作终止。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">三、设计服务交付及验收</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.乙方在接受订单后，根据甲方需求描述，设计草图，并以附件形式提交至缝纫侠。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2.甲方在收到设计草图后，应该在3个自然日内确认草图，或者在IM即时聊天工具上提出修改，乙方应根据修改内容对设计草图做出对应修改。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">3.若甲方在3个自然日内没有对订单进行操作，则自动确认设计草图，乙方开始进行技术包（Teck Pack）的设计。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">4.在确认设计草图后，订单不能被取消，但可以修改，甲方需将修改信息通过即时聊天工具发送给乙方，直至修改完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">5.乙方完成Teck Pack后，应根据缝纫侠提供的模板对Teck Pack信息进行完善，以符合甲方的需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">6、若甲方对Teck Pack有修改意见，则乙方应该尽可能满足甲方修改需求。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">7.在乙方提交Teck Pack后，若甲方在3个自然日内没有进行确认操作，则自动付款至乙方账号，交易完成。</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">8.若乙方在服务描述中表明可提供布样建议，纸片，或者样衣，则应该按照设计服务描述中内容将相关实物通过物流方式递送至甲方所在地，递送费用应包含在设计服务订单总额里面。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">四、所有权及相关权利</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">1.在甲方未确认设计草稿前，所有权归乙方所有；在甲方已确认草稿后，所有权归甲方所有；</font></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">2. 所有权转移后，乙方承诺不得再将此订单中涉及的草稿、纸样、Teck Pack等相关资料或实物进行二次销售或转卖。并不得将订单内容透露给除缝纫侠和甲方外的任何第三方。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">五、风险承担</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><font size=\"3\">若订单中涉及实物交付，在乙方按合同要求将实物送至指定的交付地点之前，货物丢失风险由乙方承担；货物送到指定地点之后，丢失风险和物理损坏均由甲方自行承担。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">六、违约责任</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">订单结束后，若甲方在其他任何第三方平台、网站、报刊、媒体等发现和订单内容相关的资料或实物的展示或售卖，有权向乙方请求赔偿。</font></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-weight: 700;\"><font size=\"3\">七、纠纷解决</font></span></span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><font size=\"3\">如履行本合同时发生争议，双方应本着首先友好协商解决的原则。如协商不成则交由甲方所在地法院诉讼解决。</font></span></p><div><span class=\"s1\"><font size=\"3\"><br></font></span></div></div>',	'<div align=\"center\"><span class=\"s1\"><p class=\"p1\" align=\"center\" style=\"line-height: 29.4px;\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-weight: bold; line-height: 24px;\"><font size=\"5\">Purchase Contract of Design Service</font></span></p><p class=\"p2\" style=\"line-height: 29.4px;\"><font size=\"3\"><span class=\"s1\"></span><br></font></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\"><span style=\"line-height: 22.4px;\">&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</span></span></font><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify; text-indent: 32px;\">Buyer (hereinafter referred to as Party A):&nbsp;</span><font size=\"3\"><span class=\"s1\"><i>:owner_name</i></span></font></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><font size=\"3\"><span class=\"s1\"><span style=\"line-height: 22.4px;\">&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</span></span></font><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify; text-indent: 32px;\">Designer (hereinafter referred to as Party B):&nbsp;</span><font size=\"3\"><span class=\"s1\"><i>:contact_name</i></span></font></p><p class=\"p4\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"font-size: medium; line-height: 1.4;\"><br></span></p><p class=\"p4\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"font-size: medium; line-height: 1.4;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">According to principles of equity and free will, Party A purchases Party B’s design service on DEFARA website,&nbsp;</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">thus the following agreement is hereby made;</span><br></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">I</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Description of Design Service</span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Name of design service:&nbsp;</span><font size=\"3\">:name</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Season of works:&nbsp;</span><font size=\"3\">:service_type</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Reference picture:&nbsp;</span><font size=\"3\"><span class=\"s1\"><i>:attachments</i></span></font></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Description of design service:&nbsp;</span><font size=\"3\">:service_description</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Quantity: 1</span><br></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: 16px; line-height: 24px; text-align: justify;\">Total amount of order:&nbsp;</span><font size=\"3\">:amount</font></span></p><p class=\"p6\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s2\"><i><font size=\"3\">:description</font></i></span></p><p class=\"p5\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">II</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Establishment of Contract</span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">1. Af</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">ter Party A selects proper designer and design service on DEFARA website, fills in the content for design service and agrees on clauses of the agreement, it shall pay to DEFARA website within 24 hours.</span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp;</span></span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">2. After receiving Party A</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s order, Party B can select whether to accept the order according to order description and Party B</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s own&nbsp;</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">arrangement</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 32px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">. If Party B accepts the order, the contract is established; if Party B does not accept the order, DEFARA will return payment to Party A automatically and the cooperation will be canceled.</span></p><p class=\"p3\" style=\"line-height: 29.4px; text-align: left;\"><span class=\"s1\"><span style=\"font-size: medium; line-height: 22.4px;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 24pt; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">3. If Party B does not operate the order within 3 days, the payment will be</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 24pt; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">returned</span><span style=\"color: rgb(0, 0, 0); text-align: justify; text-indent: 24pt; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;to Party A automatically and the cooperation will be terminated.</span></p></span><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">III</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Delivery and Acceptance of Design Service</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">1. After receiving the order, Party B will design the drawing according to Party</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">A’</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s demands and submit it to DEFARA in attachment.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">2. After receiving the design drawing, Party A shall confirm the draft within 3 natural days or propose modification via IM. Party B shall make corresponding modification to the design draft according to the modification&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">content</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">3. If Party A does not operate the order within 3 natural days, the design draft will be automatically confirmed and Party B will start the design of Teck Pack.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">4. After the design draft is&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">confirmed</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">, the order cannot be canceled, but can be modified. Party A shall send the modification information to Party B via IM until the modification is completed.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">5. After Party B finishes Teck Pack, it shall perfect Teck Pack according to the template provided by DEFARA, so as to conform to Party A</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s demands.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">6. If Party A has modification suggestions on Tech Pack, Party B shall meet Party A</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s modification demands.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">7. After Party B submits Teck Pack, if Party A does not confirm it within 3 natural days, the money will be automatically paid to Party B</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s account, and then the deal will be done.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">8. If Party B shows that it can provide suggestions on cloth pattern, scraps of paper or sample dress in service description, the related objects shall be sent to Party A</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">through logistics according to the content described in the design service. The delivery cost shall be contained in the total amount of design service order.</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">IV</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Ownership and Related Rights</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">1. Before Party A confirms the design draft, the ownership belongs to Party B; after&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">Party</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;A confirms the draft, the ownership belongs to Party A;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">2. After the ownership is&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">transferred</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">, Party B promises not to conduct secondary sales or resale of related materials or real object referred in the order such as the draft, pattern and Teck Pack, as well as not to disclose the order content to any third party except DEFARA and Party A.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">V</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Risk Taking</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">If the order involves delivery of real objects, the risk of losing goods shall be</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">under</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">taken by Party B before Party B sends the real objects to the designated delivery place according to the requirements of the contract; after the goods are sent to the designated place, the risk of losing and physical damage shall be undertaken by Party A independently.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">VI</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Liability for Breach of Contract&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">After the order ends, if Party A finds exhibition or sales of materials or real objects related to order content in any third platform, website, newspaper, media, etc., it has the right to claim for compensation from Party B.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">VII</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\">. Dispute Resolution</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\'; font-weight: bold;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-align: justify; margin-left: 0pt; text-indent: 24pt; line-height: 21px; font-size: 10.5pt; font-family: Calibri; color: rgb(0, 0, 0);\"><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">If there are disputes in&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">performance</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;of&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">the</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;contract, both parties shall stick to the principle of&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">friendly</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;negotiation. If such&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">negotiation</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">&nbsp;fails, the disputes shall be submitted to Party A</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">’</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\';\">s local court.</span></p></div>',	9,	'[\"name\",\"service_description\",\"description\",\"amount\",\"owner_name\",\"contact_name\",\"service_type\",\"attachments\"]',	'SERVICE',	'2016-05-27 11:17:40',	'2016-05-27 11:17:40');
