(2,	2,	1571,	0,	0,	2,	'我在时装设计领域有着专业的工作和教育经验。凭借对设计、造型、艺术和自然系生活方式的深深热爱，我从未停止过创作的脚步。在未来，我希望能创建一间服装设计公司，汇聚一群富有热情的时装设计师们，让大家在一起工作，一同创作。',	'I have professional and educational experiences in fashion design. With deep love for designing,  styling, art and natural lifestyle, I never stop creating new fashion works. In future, I hope to establish my apparel design company, where passionate fashion designers can work together and create together.',	NULL,	'[{\"school\":\"\\u7687\\u5bb6\\u8bbe\\u8ba1\\u5b66\\u9662\",\"major\":\"\\u670d\\u88c5\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"Royal College of Art\",\"major\":\"Fashion Design\"}]',	'[{\"place\":\"\\u81ea\\u7531\\u804c\\u4e1a\",\"position\":\"\\u8d44\\u6df1\\u670d\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"River Island\",\"position\":\"\\u5973\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"Cheap Monday\",\"position\":\"\\u52a9\\u7406\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"Freelance\",\"position\":\"Senior Fashion Designer\"},{\"place\":\"River Island\",\"position\":\"Women Fashion Designer\"},{\"place\":\"Cheap Monday\",\"position\":\"Associate Designer\"}]',	'[\"River Island\",\"Cheap Monday\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
