(17,	26,	1608,	0,	0,	1,	'经过与意大利顶尖品牌30年的合作，塞尔吉奥·莫斯科在时装设计领域的知识更加深入，他决定开展自己的工作室，向自有品牌制造编织和针织产品提供咨询顾问。',	'After a thirty years experience with top level Italian brands, strong of his extended and deep knowledge of the field, Sergio Mosca decided to start his own studio, offering consultancies to private labels for the creation of their woven and knit collections.',	NULL,	'[{\"school\":\"Istituto Cesare Correnti Milano (MI) ITALY\",\"major\":\"\\u6444\\u5f71\\uff0c\\u56fe\\u5f62\\u8bbe\\u8ba1\\u548c\\u65f6\\u5c1a\"}]',	'[{\"school\":\"Istituto Cesare Correnti Milano (MI) ITALY\",\"major\":\"Photograph, graphics and fashion\"}]',	'[{\"place\":\"S.M | Sergio Mosca\\u5de5\\u4f5c\\u5ba4\",\"position\":\"\\u65f6\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"Annapi\\u00f9 Tricot \",\"position\":\"\\u81ea\\u7531\\u65f6\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"Trussardi S.p.A. \",\"position\":\"\\u4ea7\\u54c1\\u7ecf\\u7406\"}]',	'[{\"place\":\"S.M | Sergio Mosca Studio Stilistico \",\"position\":\"Fashion Designer \"},{\"place\":\"Annapi\\u00f9 Tricot \",\"position\":\"Fashion Designer Freelance \"},{\"place\":\"Trussardi S.p.A. \",\"position\":\"Product Manager \"}]',	NULL,	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
