(34,	53,	1608,	0,	0,	2,	'我不仅是一个艺术家，更是一名探索者；我环游世界，用时尚的眼光发现各地的文化魅力。满溢我心的热情，促使我学习一切能激发灵感的知识，比如艺术、历史、地理、自然等等。我的新创意迸发自新视野，而且我十分善于用其感染他人。我梦想着，创立一个充满色彩与美的世界……',	'I do i identified my self like a ARTIST and RESEARCHER, i been travel and visit the world, culture and location with special effect in the fashion direction, my passion take me study Art, History , geography, nature and any discipline can full my hart of idea and feeling. I \'m able to Make new idea from vision, and transfer to other people, my dream is be surrounded from a world of colors, and beauty ..... ',	NULL,	'[{\"school\":\"\\u7f57\\u9a6cKoefia\\u5b66\\u9662\",\"major\":\"\\u670d\\u88c5\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"accademia Koefia- Rome\",\"major\":\"fashion Designer\"}]',	'[{\"place\":\"MC\\u8bbe\\u8ba1\\u5de5\\u4f5c\\u5ba4\",\"position\":\"\\u827a\\u672f\\u603b\\u76d1\"}]',	'[{\"place\":\"mc design studio ltd\",\"position\":\"art director\"}]',	'[\"D&G\",\"Calvin Klein\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
(35,	54,	3088,	0,	0,	2,	'我是一名自由设计师，有10年以上的图案设计经验。无论是小型设计工作室、服装制造商，还是知名时装品牌，我都合作过。在创意、生产、商业环节，我都积累了丰富的经验。',	'My name is MiquelAngel and i\'m a freelance graphic designer with more than 10 years of experience. I\'ve been working with small design studios, big fashion retail brands or direct factories so i can offer a wide experience in creative, comercial and productive part.',	NULL,	'[{\"school\":\"ESDI\\u9ad8\\u7b49\\u8bbe\\u8ba1\\u5b66\\u6821\",\"major\":\"\\u670d\\u88c5\\u4e0e\\u9762\\u6599\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"ESDI\",\"major\":\"Fashion and Fabric Designer\"}]',	'[{\"place\":\"CAROLINA HERRERA\",\"position\":\"\\u7537\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"PURIFICACION GARCIA\",\"position\":\"\\u7537\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\" ANTONIO ALVARADO\",\"position\":\"\\u5973\\u88c5\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"CAROLINA HERRERA\",\"position\":\"Men Fashion Designer\"},{\"place\":\"PURIFICACION GARCIA\",\"position\":\"Men Fashion Designer\"},{\"place\":\"ANTONIO ALVARADO\",\"position\":\"Women Fashion Designer\"}]',	'[\"ZARA\",\"BERSHKA\",\"PULL&BEAR\",\"CELIO\",\"BRICE\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
