(49,	70,	3610,	0,	0,	2,	'我是一名自由设计师，专注于女装设计。现在为一些英国知名高街品牌供稿，如John Lewis、M&S、 Jacques Vert、Warehouse,、Debenhams 、 Four Seasons等等。我尤其擅长休闲风格的棉服、风衣设计。我在其他领域也积累了丰富的经验，比如裁缝、童装设计。',	'I\'m a Freelance Designer working on Ladies Outerwear and currently working part time for a supplier (Shani Ltd.) to the UK High Street chains such as John Lewis, M&S, Jacques Vert, Warehouse, Debenhams and Four Seasons. I specialise in the smart casual padded/quilted jackets and casual jackets and parkas. I have had previous experience of other areas such as tailoring and soft separates and have also done the same for childrenswear. ',	NULL,	'[{\"school\":\"\\u5fb7\\u6bd4\\u5927\\u5b66\",\"major\":\"\\u670d\\u88c5\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"Derby University\",\"major\":\"Fashion Design\"}]',	'[{\"place\":\"\\u81ea\\u7531\\u8bbe\\u8ba1\\u5e08\",\"position\":\"\\u8bbe\\u8ba1\\u5e08\\/\\u987e\\u95ee\"},{\"place\":\"Stuart Peters\\u6709\\u9650\\u516c\\u53f8\",\"position\":\"\\u8d44\\u6df1\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"K&A\",\"position\":\"\\u9996\\u5e2d\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"Freelance\",\"position\":\"Designer\\/Consultant\"},{\"place\":\"Stuart Peters Ltd\",\"position\":\"Senior Designer\"},{\"place\":\"K&A Fashions\",\"position\":\"Head of Design\"}]',	'[\"Marks & Spencers\",\"Asda (George)\",\"Cath Kidston\",\"River Island\",\"Debenhams\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
