(52,	73,	1161,	0,	0,	1,	'我是独立品牌Land Kay的创意总监。得益于我的时尚行业从业经验，以及对布拉格风情、意大利美食的热爱，我现在专注于艺术事业、时尚插画、印花设计、美食、历史建筑、珠宝、书法。作为一名印花设计师，我非常擅长将手绘水彩运用到女装、室内设计中。',	'I’m a Creative Director of Land Kay Brand. Inspired by my fashion experience, Prague’s atmosphere, and my love of Italian cuisine, I focus my artwork and lifestyle around vogue illustrations, textile prints, delicious food, historical architecture, jewellery and calligraphy. As a Textile Designer I concentrate on ladies’ fashion and home textiles using hand drawing with watercolour.',	NULL,	'[{\"school\":\"\",\"major\":\"\"}]',	'[{\"school\":\"\",\"major\":\"\"}]',	'[{\"place\":\"\\u65f6\\u5c1a\\u6742\\u5fd7\",\"position\":\"\\u8d44\\u6df1\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"Fashion Magazine\",\"position\":\"Senior Designer\"}]',	'[\"Land Kay\",\"Ksenia Knyazeva\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:05'),
