(215,	300,	3678,	3679,	3680,	1,	'我目前任职于自己的设计工作室，同时也承接一些兼职的设计工作。我专注于鞋履设计，尤其擅长女鞋设计。我有敏锐的市场触觉，能够灵活变换思路以适应当前市场，并预测潮流趋势。',	'Currently I am working on my own design studio and also doing some freelance work. I’m skilled at footwear design, especially women footwear design. With an impressive market feeling, I have a high capacity to think outside the box and interpret what the trend will be in the market . ',	'',	'[{\"school\":\"\\u5e15\\u68ee\\u65af\\u8bbe\\u8ba1\\u5b66\\u9662\",\"major\":\"\\u670d\\u88c5\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"Parsons The New School for Design\",\"major\":\"Fashion Design\"}]',	'[{\"company\":\"\",\"position\":\"\\u827a\\u672f\\u603b\\u76d1&\\u521b\\u59cb\\u4eba\"},{\"company\":\"\",\"position\":\"\\u5973\\u978b\\u8bbe\\u8ba1\\u5e08\"},{\"company\":\"\",\"position\":\"\\u978b\\u5c65\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"KR Design Studio\",\"position\":\"Art Director & Founder\"},{\"place\":\"Steve Madden\",\"position\":\"Women\\u2019s Shoes Designer\"},{\"place\":\"Sliver Shoe Company\",\"position\":\"Shoes Designer\"}]',	'[\"Steve Madden\",\"minnetonka\",\"H&M\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-05-20 08:19:17'),
(216,	301,	3610,	0,	0,	2,	'热爱时尚，热爱设计，我充满激情，思想前卫，结果为导向，旅游是我的爱好。',	'Loving fashion and design, I am A motivated, forward thinking, result oriented and well-travelled designer.',	NULL,	'[{\"school\":\"\\u7687\\u5bb6\\u827a\\u672f\\u5b66\\u9662\",\"major\":\"\\u65f6\\u5c1a\\u5973\\u88c5\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"Royal College of Art\",\"major\":\"MA, Womenswear Fashion Design\"}]',	'[{\"place\":\"J.Crew\",\"position\":\"\\u8d44\\u6df1\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"J.Crew\",\"position\":\"Executive Fashion Designer \"}]',	'[\"Fendi\",\"Urban Outfitters \"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(217,	302,	1308,	0,	0,	1,	'十年的设计经验，七年的时尚设计管理工作\r\n亲自在毛衫生产的第一线\r\n所有的分类都有设计过，诸如：牛仔，短裤，羊绒外套，轻质夹克，西装，毛衫等织物，风格自由休闲，但不失场合。\r\n',	'-10 years experience, 7 years managing a team. \r\n-Hands-on work developing and producing Knitwear factories \r\n-Comfortable in all classifications and have designed all categories at some point - Denim, Chinos, Joggers, Shorts, Wool Outerwear, Light-weight Jackets, Suit Separates, Knits, Sweaters, and lots of Woven Shirts -- both Casual and Dressy.\r\n',	NULL,	'[{\"school\":\"Academy of Art University\",\"major\":\"\\u6bdb\\u886b\\u8bbe\\u8ba1\"}]',	'[{\"school\":\"Academy of Art University\",\"major\":\"MFA, Fashion and Knitwear Design\"}]',	'[{\"place\":\"JC Penney\",\"position\":\"\\u9ad8\\u7ea7\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"JC Penney\",\"position\":\" Senior Designer\"}]',	'[\"M&S\",\" Zara\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(218,	303,	538,	556,	558,	2,	'我目前在DEFARA担任服装设计师。我热爱与时装设计有关的一切，新创意往往迸发自新视野。得益于之前的平面设计从业经验，我在印花设计、时尚插画领域更具备突出的优势。',	'我目前在DEFARA担任服装设计师。我热爱与时装设计有关的一切，新创意往往迸发自新视野。得益于之前的平面设计从业经验，我在印花设计、时尚插画领域更具备突出的优势。',	NULL,	'[{\"school\":\"\\u9999\\u6e2f\\u7406\\u5de5\\u5927\\u5b66\",\"major\":\"\\u89c6\\u89c9\\u4f20\\u8fbe\"}]',	'[{\"school\":\"The Hong Kong Polytechnic University\",\"major\":\"Visual Communication\"}]',	'[{\"place\":\"DEFARA\",\"position\":\" \\u8d44\\u6df1\\u670d\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"CA\\u5de5\\u4f5c\\u5ba4\",\"position\":\"\\u670d\\u88c5\\u8bbe\\u8ba1\\u5e08\"},{\"place\":\"\\u82f1\\u53e4\\u8d1d\\u514b\",\"position\":\"\\u5e73\\u9762\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"DEFARA\",\"position\":\"Senior Fashion Designer\"},{\"place\":\"CA Studio\",\"position\":\"Fashion Designer\"},{\"place\":\"Ingobk\",\"position\":\"Graphic Designer\"}]',	'[\"Selected\",\"Jason Plus\",\"DEFARA\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(219,	304,	3610,	0,	0,	3,	'从原料和时装设计到造型和品牌，在时装行业我都有着丰富的经验。我有发现色彩的眼睛，充满创造性的想象力，简单是我设计的主要风格。',	'I have comprehensive experience in fashion industry, from fabric and fashion design to styling and branding. I have eye for colors, imagination of creativity and minimalism is the main style of my designs.',	NULL,	'[{\"school\":\"\\u65f6\\u88c5\\u8bbe\\u8ba1\",\"major\":\"\\u8bfa\\u4e01\\u6c49\\u7279\\u4f26\\u7279\\u5927\\u5b66\"}]',	'[{\"school\":\"Fashion\\/Apparel Design\",\"major\":\"The Nottingham Trent University\"}]',	'[{\"place\":\"\\u521d\\u7ea7\\u8bbe\\u8ba1\\u5e08\",\"position\":\"Hottop Ltd\"},{\"place\":\"\\u5973\\u88c5\\u8bbe\\u8ba1\\u5e08\",\"position\":\"Hya Design\"},{\"place\":\"\\u5973\\u88c5\\u8bbe\\u8ba1\\u5e08\",\"position\":\"Conran Ladieswear\"}]',	'[{\"place\":\"Junior Designer \",\"position\":\"Hottop Ltd\"},{\"place\":\"Womenswear Designer \",\"position\":\"Hya Design\"},{\"place\":\"Womenswear Designer \",\"position\":\"Conran Ladieswear\"}]',	'[\"Hya Design\",\"Conran Ladieswear\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(220,	307,	538,	0,	0,	3,	'作为一名自由设计师，我已在针织服饰行业积累了5年以上的设计经验。我学习过心理学与市场营销的专业知识，这使我能从专业的角度，基于目标消费者与时尚流行趋势，分析市场与服装产品。',	'I have worked as a fashion designer for more than 5 years in the knitting garment markets as a freelance designer. My psychological and marketing specialized education background enables me to strategically analyze the market and designs products based on target customer needs and fashion trends.  ',	NULL,	'[{\"school\":\"\\u58a8\\u5c14\\u672c\\u5927\\u5b66\",\"major\":\"\\u5546\\u52a1\\u7cfb\\u7edf\\u4e0e\\u5206\\u6790\"},{\"school\":\"\\u83ab\\u7eb3\\u4ec0\\u5927\\u5b66\",\"major\":\"\\u5fc3\\u7406\\u5b66\\u4e0e\\u5e02\\u573a\\u8425\\u9500\"}]',	'[{\"school\":\"Melbourne University\",\"major\":\"Business Systems and Analysis\"},{\"school\":\"Monash University\",\"major\":\"Psychology and Marketing (Management)\"}]',	'[{\"place\":\"\\u81ea\\u7531\\u804c\\u4e1a\",\"position\":\"\\u9488\\u7ec7\\u670d\\u9970\\u8bbe\\u8ba1\\u5e08\"}]',	'[{\"place\":\"Freelance\",\"position\":\"Knitwear Designer\"}]',	'[\"-\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
