(231,	339,	1608,	0,	0,	1,	'Cubo fashion consulting 是时尚设计工作室，我们和全球国际时尚品牌合作过，提供时尚行业水平思考，灵感和专业的时尚设计服务以及技术制作。',	'CUBO FASHION CONSULTING IS A TEAM OF SPECIALIZED CONSULTANTS. DURING THE YEARS WE HAVE BEEN PARTNERS OF INTERNATIONAL BRAND PROVIDING FASHION INDUSTRY WITH LATERAL THINKING, CREATIVITY AND DESIGN, TECHNOLOGICAL KNOW HOW.',	NULL,	NULL,	NULL,	NULL,	NULL,	'[\"Wrangler\",\"REPLAY\",\"AVIREX\",\"cotton belt\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(232,	340,	1608,	0,	0,	2,	'在服饰演变和细节设计中，一直积极乐观，仔细好奇，是全球时尚行业的雷达，探索最新的服装设计风格，在跨国时尚交流中非常有经验。 她在米兰Marangoni Institute研究服装设计，毕业于伦敦中央圣马丁学院设计学院',	'Born in Sicily, enthusiastic and positive, curious and careful with an excellent attention to details and costumes evolution, a true radar scanning the globe. Intuition and natural predisposition to art in all its forms and technology, fascinated by historic past. Professional experiences fully grown in multinational corporations, she made her studies at Marangoni Institute in Milan and specialized at Central Saint Martins, London.',	NULL,	'[{\"school\":\"\\u4f26\\u6566\\u4e2d\\u592e\\u5723\\u9a6c\\u4e01\\u5b66\\u9662\",\"major\":\"\\u8bbe\\u8ba1\\u5b66\\u9662\"}]',	'[{\"school\":\"Prior Park College\",\"major\":\" Central Saint Martins,\"}]',	'[{\"place\":\"Ufficio Stile\",\"position\":\"\\u65f6\\u5c1a\\u98ce\\u683c\\u5e08\\u548c\\u4ea7\\u54c1\\u52a9\\u7406\"},{\"place\":\"Cubo Fashion Consulting\",\"position\":\"\\u65f6\\u5c1a\\u8bbe\\u8ba1\\u5e08\\u548c\\u65f6\\u5c1a\\u98ce\\u683c\\u5e08\"}]',	'[{\"place\":\"Ufficio Stile\",\"position\":\"Stylist and Product Assistant\"},{\"place\":\"Cubo Fashion Consulting\",\"position\":\"Designer. Stylist & Product\"}]',	NULL,	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
(233,	341,	1608,	0,	0,	3,	'出身于牛仔时间，与美国纽约同行业的设计师和产品技术人员一起成长，在时尚行业专业巨头，测试牛仔洗护，材料生产技术，样品细节，美学艺术的创新和精湛的皮革方面的工作',	'Born and raised among denim, grown as fashion designer and product technician in Americanino and New York Industries, a professional life spent along fashion industrial giants, testing denim treatments and washing processes, fabric manufacturing techniques, sample details constructions, esthetic innovations and leather elaborations.',	NULL,	'[{\"school\":\"ITIS G MARCONI\",\"major\":\"\\u670d\\u9970\"}]',	'[{\"school\":\"ITIS G MARCONI\",\"major\":\"perito industriale dell\'abbigliamento\"}]',	'[{\"place\":\"CUBO FASHION CONSULTING\",\"position\":\"\\u65f6\\u5c1a\\u8bbe\\u8ba1\\u5e08&\\u4ea7\\u54c1\\u7ecf\\u7406\"}]',	'[{\"place\":\"CUBO FASHION CONSULTING\",\"position\":\"Fashion Designer & Product Manager\"}]',	NULL,	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
