(239,	352,	1608,	0,	0,	1,	'Mauro Gasper是意大利人，毕业于国际时尚佛罗伦萨大学服装设计和针织设计硕士研究生专业。2008年在布雷西亚自己开设了自己的第一家服装旗舰店，旨在刷新四海一家，全球共享的休闲，随意，自由和当代精髓城市风格。与此同时他本人参加了09年米兰时装周，接下来是将自己的设计作品早世界各地的时装周展示，如东京，基辅，华沙，蒙特卡洛（摩纳哥城市，德国柏林，中国广州和莫斯科等地。Mauro Gasper讲自己在米兰时装周的作品和意大利制造辗转世界各地各大shopping mall，从日本到迪拜，即将登陆中国和美国.',	'Born in Italy, Mauro Gasper has his own flagship store in Italy after his graduation from Artistic school in Brescia. He enters consequently in the project New Upcoming Designers and in Milan Fashion Week, and could have catwalks in Fashion Weeks of Tokyo, Kiev, Varsaw Berlin and Guangzhou. ',	NULL,	NULL,	NULL,	NULL,	NULL,	'[\"Paola Frani\",\"Doratex\",\"Cristiano Fissore\",\"D&G\"]',	NULL,	NULL,	'2016-04-12 04:49:06',	'2016-04-12 04:49:06'),
