(35,	49,	'My work',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/c5ea15cb3fbb320ac642e768239bc310.jpg\'alt=\'\' /></p><p>用独有的视角和审美为现代女性带来全新的体验和感受.强调线条与结构的美学,在质量与美感并重的同时,也将在传统与现代时装的创新性与实用性中找到更好的平衡.</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/c5ea15cb3fbb320ac642e768239bc310.jpg\'alt=\'\' /></p><p>用独有的视角和审美为现代女性带来全新的体验和感受.强调线条与结构的美学,在质量与美感并重的同时,也将在传统与现代时装的创新性与实用性中找到更好的平衡.</p>',	'用独有的视角和审美为现代女性带来全新的体验和感受.强调线条与结构的美学,在质量与美感并重的同时,也将在传统与现代时装的创新性与实用性中找到更好的平衡.',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/01/c5ea15cb3fbb320ac642e768239bc310.jpg',	1,	'ACTIVE',	'',	'2015-09-01 07:27:45',	'2016-05-12 05:08:36',	NULL),
(36,	49,	'My life',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/f45664113d735f2b1b569e281ff42071.jpg\'alt=\'\' /></p><p>我想，我就是为设计而生的，在我17、18岁的时候，我就和我的家人说，我想要成为一个设计师，用尽我的一生去做设计。从小，我的父母总是鼓励我去玩，现在，我依旧在玩。我会在每个重要会议之前玩游戏，以确保我的头脑保持灵光。 生活和工作对于我来说是合一的，平时，我会和我的家人谈论设计，我的孩子们给了我很多灵感启发，我展示厅的每一件样品，我都精心设计。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/f45664113d735f2b1b569e281ff42071.jpg\'alt=\'\' /></p><p>我想，我就是为设计而生的，在我17、18岁的时候，我就和我的家人说，我想要成为一个设计师，用尽我的一生去做设计。从小，我的父母总是鼓励我去玩，现在，我依旧在玩。我会在每个重要会议之前玩游戏，以确保我的头脑保持灵光。 生活和工作对于我来说是合一的，平时，我会和我的家人谈论设计，我的孩子们给了我很多灵感启发，我展示厅的每一件样品，我都精心设计。</p>',	'我想，我就是为设计而生的，在我17、18岁的时候，我就和我的家人说，我想要成为一个设计师，用尽我的一生去做设计。从小，我的父母总是鼓励我去玩，现在，我依旧在玩。我会在每个重要会议之前玩游戏，以确保我的头脑保持灵光。 生活和工作对于我来说是合一的，平时，我会和我的家人谈论设计，我的孩子们给了我很多灵感启发，我展示厅的每一件样品，我都精心设计。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/01/f45664113d735f2b1b569e281ff42071.jpg',	2,	'ACTIVE',	'',	'2015-09-01 07:28:34',	'2016-05-12 05:08:36',	NULL),
(37,	49,	'My idea',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/61d7ae0ac0c2a5e9c9b54acedba11c1a.jpg\'alt=\'\' /></p><p>所谓时尚，是一种风格，也是一种生活态度，不盲从，不跟风，浅吟低唱，用品质与细节来诠释时尚的真谛。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/01/61d7ae0ac0c2a5e9c9b54acedba11c1a.jpg\'alt=\'\' /></p><p>所谓时尚，是一种风格，也是一种生活态度，不盲从，不跟风，浅吟低唱，用品质与细节来诠释时尚的真谛。</p>',	'所谓时尚，是一种风格，也是一种生活态度，不盲从，不跟风，浅吟低唱，用品质与细节来诠释时尚的真谛。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/01/61d7ae0ac0c2a5e9c9b54acedba11c1a.jpg',	3,	'ACTIVE',	'',	'2015-09-01 07:29:51',	'2016-05-12 05:08:36',	NULL),
