(126,	7,	'My idea',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/ad59ed3bce3c9bd5c20fff8cb2e26a73.jpg\'alt=\'\' /></p><p>保持先锋独立的时尚态度，并不断在时尚的相关领域作出更多的尝试。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/ad59ed3bce3c9bd5c20fff8cb2e26a73.jpg\'alt=\'\' /></p><p>保持先锋独立的时尚态度，并不断在时尚的相关领域作出更多的尝试。</p>',	'保持先锋独立的时尚态度，并不断在时尚的相关领域作出更多的尝试。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/02/ad59ed3bce3c9bd5c20fff8cb2e26a73.jpg',	3,	'ACTIVE',	'',	'2015-09-02 04:01:58',	'2016-05-12 05:08:36',	NULL),
(127,	10,	'My work',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/e20430687c7867fee23b686995500254.jpg\'alt=\'\' /></p><p>希望作品传承“慢时尚”、“持续性”的概念，与“快时尚”恰巧相反，然后慢慢过渡到“可持续的时尚”。因为精挑细选的材料，不仅是传统与时尚的经典结合，也是民族风和环境意识的体现。设计作品全部都是利用天然或者回收利用的材料，由东南亚的手工作坊的妇女们手工制作而成。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/e20430687c7867fee23b686995500254.jpg\'alt=\'\' /></p><p>希望作品传承“慢时尚”、“持续性”的概念，与“快时尚”恰巧相反，然后慢慢过渡到“可持续的时尚”。因为精挑细选的材料，不仅是传统与时尚的经典结合，也是民族风和环境意识的体现。设计作品全部都是利用天然或者回收利用的材料，由东南亚的手工作坊的妇女们手工制作而成。</p>',	'希望作品传承“慢时尚”、“持续性”的概念，与“快时尚”恰巧相反，然后慢慢过渡到“可持续的时尚”。因为精挑细选的材料，不仅是传统与时尚的经典结合，也是民族风和环境意识的体现。设计作品全部都是利用天然或者回收利用的材料，由东南亚的手工作坊的妇女们手工制作而成。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/02/e20430687c7867fee23b686995500254.jpg',	1,	'ACTIVE',	'',	'2015-09-02 06:58:00',	'2016-05-12 05:08:36',	NULL),
(128,	10,	'My life',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/9bb69da6f43fc9d7b2bee91d6116fa72.jpg\'alt=\'\' /></p><p>涂鸦、狂野的图案、色彩鲜艳的服装，正流行于韩国的大街小巷。当时我还在幼儿园，但到今天我依然记得那时对这些色彩和有机形态的迷恋。许多年后，这些简洁的色彩艺术依然影响着我的内心。30多年后，在给许多品牌做设计时，我依然会想到这些场景，它让我保有这种天真。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/9bb69da6f43fc9d7b2bee91d6116fa72.jpg\'alt=\'\' /></p><p>涂鸦、狂野的图案、色彩鲜艳的服装，正流行于韩国的大街小巷。当时我还在幼儿园，但到今天我依然记得那时对这些色彩和有机形态的迷恋。许多年后，这些简洁的色彩艺术依然影响着我的内心。30多年后，在给许多品牌做设计时，我依然会想到这些场景，它让我保有这种天真。</p>',	'涂鸦、狂野的图案、色彩鲜艳的服装，正流行于韩国的大街小巷。当时我还在幼儿园，但到今天我依然记得那时对这些色彩和有机形态的迷恋。许多年后，这些简洁的色彩艺术依然影响着我的内心。30多年后，在给许多品牌做设计时，我依然会想到这些场景，它让我保有这种天真。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/02/9bb69da6f43fc9d7b2bee91d6116fa72.jpg',	2,	'ACTIVE',	'',	'2015-09-02 07:01:03',	'2016-05-12 05:08:36',	NULL),
(129,	10,	'My idea',	'',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/e2f46f8262a9607185989284a8c6e2b5.jpg\'alt=\'\' /></p><p>作品融合极简主义的设计理念，将功能性与极简美学的融合作为设计出发点，以达成有品质的设计与优良的着衣舒适度。设计作品以几何线条等空间基本元素作为设计的核心结构，摒除一切冗余装饰，以整体结构的细节趣味充实设计的完整度。力求为现代都市女性展现自我完整人格提供由外而观内相的风格化衣着。</p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/09/02/e2f46f8262a9607185989284a8c6e2b5.jpg\'alt=\'\' /></p><p>作品融合极简主义的设计理念，将功能性与极简美学的融合作为设计出发点，以达成有品质的设计与优良的着衣舒适度。设计作品以几何线条等空间基本元素作为设计的核心结构，摒除一切冗余装饰，以整体结构的细节趣味充实设计的完整度。力求为现代都市女性展现自我完整人格提供由外而观内相的风格化衣着。</p>',	'作品融合极简主义的设计理念，将功能性与极简美学的融合作为设计出发点，以达成有品质的设计与优良的着衣舒适度。设计作品以几何线条等空间基本元素作为设计的核心结构，摒除一切冗余装饰，以整体结构的细节趣味充实设计的完整度。力求为现代都市女性展现自我完整人格提供由外而观内相的风格化衣着。',	'',	'https://defara.imgix.net/userdata/assets/content/2015/09/02/e2f46f8262a9607185989284a8c6e2b5.jpg',	3,	'ACTIVE',	'',	'2015-09-02 07:02:03',	'2016-05-12 05:08:36',	NULL),
