(229,	129,	'我的设计概念和表述',	'Conception & Expression',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/10/15/523cd7184e4f00599b4071e0c0bbde887622515b.jpg\'alt=\'\' /></p><p>这个设计集结合了风格，颜色，幽默和有趣的材料，让穿上它的人感觉到质量带来的舒适</p><p><img src=\'http://localhost/assets/Content/2015/10/15/2bf8ef8e0526f444406d0f9c40976ae78a6cc817.jpg\'alt=\'\' /></p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/10/15/523cd7184e4f00599b4071e0c0bbde887622515b.jpg\'alt=\'\' /></p><p>The collection combines conventional styles with bold colors, humor and interesting materials, giving it the quality of being relatable yet outstanding for the wearer. </p><p><img src=\'http://localhost/assets/Content/2015/10/15/2bf8ef8e0526f444406d0f9c40976ae78a6cc817.jpg\'alt=\'\' /></p>',	'这个设计集结合了风格，颜色，幽默和有趣的材料，让穿上它的人感觉到质量带来的舒适',	'The collection combines conventional styles with bold colors, humor and interesting materials, giving it the quality of being relatable yet outstanding for the wearer. ',	'https://defara.imgix.net/userdata/assets/content/2015/10/15/523cd7184e4f00599b4071e0c0bbde887622515b.jpg',	2,	'ACTIVE',	'',	'2015-10-15 02:32:21',	'2016-05-12 05:08:36',	NULL),
(230,	129,	'我的设计概念和表述',	'Conception & Expression',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/10/15/303d87a8c7030eafe58f3b7325a824a37c29770d.jpg\'alt=\'\' /></p><p>这个专辑基于三个核心价值，古怪，积极，和多样化</p><p><img src=\'http://localhost/assets/Content/2015/10/15/7e5613cebec4182f6c7565eedc7b3d1fc404084d.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/recommend/content/2016/02/02/4cbb2a3d51a1ac227c4643715111498c.jpg\'alt=\'\' /></p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/10/15/303d87a8c7030eafe58f3b7325a824a37c29770d.jpg\'alt=\'\' /></p><p>Exploring the field of personal identity, I aimed to understand how clothes are being used to express ourselves. Alluding to the philosophy of existentialism, the collection was founded on three core values; curiosity, diversity & positivity. </p><p><img src=\'http://localhost/assets/Content/2015/10/15/7e5613cebec4182f6c7565eedc7b3d1fc404084d.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/recommend/content/2016/02/02/4cbb2a3d51a1ac227c4643715111498c.jpg\'alt=\'\' /></p>',	'这个专辑基于三个核心价值，古怪，积极，和多样化',	'Exploring the field of personal identity, I aimed to understand how clothes are being used to express ourselves. Alluding to the philosophy of existentialism, the collection was founded on three core values; curiosity, diversity & positivity. ',	'https://defara.imgix.net/userdata/assets/content/2015/10/15/303d87a8c7030eafe58f3b7325a824a37c29770d.jpg',	3,	'ACTIVE',	'',	'2015-10-15 02:33:44',	'2016-05-12 05:08:36',	NULL),
