(314,	231,	'时尚趋势',	'Fashion Trend Panels',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/0b01c13e18bd4a51743b56555790044b351b6ce6.jpg\'alt=\'\' /></p><p>在Imaginner趋势图中，我搜索我喜欢的图片和趋势，想尽力表达之后的灵感，创作雏形和趋势。竭尽所能加入我的自己的风格材质等</p><p><img src=\'http://localhost/assets/Content/2015/11/20/367d4ebab7318f6cdaf8ee63cbd48164e015c808.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/1f6168231b87a6a23fff9fdcf5601d221733faa5.jpg\'alt=\'\' /></p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/0b01c13e18bd4a51743b56555790044b351b6ce6.jpg\'alt=\'\' /></p><p>In \"Imagineer\" first trend panel, I searched for images and trends that I liked. I wanted to try to identify the inspirations for later, create a silhouette, create a trend. I tried to imagine my own style and suddenly, all sort of materials were mixed </p><p><img src=\'http://localhost/assets/Content/2015/11/20/367d4ebab7318f6cdaf8ee63cbd48164e015c808.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/1f6168231b87a6a23fff9fdcf5601d221733faa5.jpg\'alt=\'\' /></p>',	'在Imaginner趋势图中，我搜索我喜欢的图片和趋势，想尽力表达之后的灵感，创作雏形和趋势。竭尽所能加入我的自己的风格材质等',	'In \"Imagineer\" first trend panel, I searched for images and trends that I liked. I wanted to try to identify the inspirations for later, create a silhouette, create a trend. I tried to imagine my own style and suddenly, all sort of materials were mixed ',	'https://defara.imgix.net/userdata/assets/content/2015/11/20/0b01c13e18bd4a51743b56555790044b351b6ce6.jpg',	1,	'ACTIVE',	'',	'2015-11-20 06:24:28',	'2016-05-12 05:08:37',	NULL),
(315,	231,	'秘密的配件',	'Secrets of the Senses Accessories',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/beadbe9d81e95678b83891deef38756787a4502b.png\'alt=\'\' /></p><p>这个图集是我的包和项链设计细节。</p><p><img src=\'http://localhost/assets/Content/2015/11/20/e07f950f56f63dd44d79833375f748b9f49d98de.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/9c21b7ca8927af838c8d1f6c28bdcb4128fc0452.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/0e782be9d2fdee48463f3d0179e070b3547bfb74.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/f6d9ac1ac411c4fff663580b1b56a860b9d6a002.jpg\'alt=\'\' /></p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/beadbe9d81e95678b83891deef38756787a4502b.png\'alt=\'\' /></p><p>Some types of accesories as bags and necklaces full of details. First image shows a rectangle hangbag made with different fabric combitions, details of little holes which represent leaves. I used several composition of threads, some with more cotton </p><p><img src=\'http://localhost/assets/Content/2015/11/20/e07f950f56f63dd44d79833375f748b9f49d98de.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/9c21b7ca8927af838c8d1f6c28bdcb4128fc0452.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/0e782be9d2fdee48463f3d0179e070b3547bfb74.jpg\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/f6d9ac1ac411c4fff663580b1b56a860b9d6a002.jpg\'alt=\'\' /></p>',	'这个图集是我的包和项链设计细节。',	'Some types of accesories as bags and necklaces full of details. First image shows a rectangle hangbag made with different fabric combitions, details of little holes which represent leaves. I used several composition of threads, some with more cotton ',	'https://defara.imgix.net/userdata/assets/content/2015/11/20/beadbe9d81e95678b83891deef38756787a4502b.png',	2,	'ACTIVE',	'',	'2015-11-20 06:28:52',	'2016-05-12 05:08:3