(316,	231,	'包和配饰设计',	'Bags and Accessories Design for Misako',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/dace96ce17eb5b51bbeeb36b2bfec05c7e183344.png\'alt=\'\' /></p><p>以下包，腰带，和珠宝等配饰的设计集是我和我同事一起设计并开发。</p><p><img src=\'http://localhost/assets/Content/2015/11/20/974c0f3f87ed7e51d877ec35f5c8174e1ef26938.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/5732361b5fa70cbda84f32b61fcea3b0a9cae52a.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/b526197c85c181098f916417c92c5093a928e30c.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/2435ce916facdabba756c32aa1a21fd92bbdf9fe.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/cb3e11909bea9fcf38f61378163c76ea9ebeaec1.png\'alt=\'\' /></p>',	'<p><img src=\'https://defara.imgix.net/userdata/assets/content/2015/11/20/dace96ce17eb5b51bbeeb36b2bfec05c7e183344.png\'alt=\'\' /></p><p>I worked in Misako as a junior designer since november 2010 for six months. I was working with another colleague to develop hangbags, belts and jewellery collections as pictures below. I designed clucht party hanbags made in fabric with special details </p><p><img src=\'http://localhost/assets/Content/2015/11/20/974c0f3f87ed7e51d877ec35f5c8174e1ef26938.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/5732361b5fa70cbda84f32b61fcea3b0a9cae52a.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/b526197c85c181098f916417c92c5093a928e30c.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/2435ce916facdabba756c32aa1a21fd92bbdf9fe.png\'alt=\'\' /></p><p><img src=\'http://localhost/assets/Content/2015/11/20/cb3e11909bea9fcf38f61378163c76ea9ebeaec1.png\'alt=\'\' /></p>',	'以下包，腰带，和珠宝等配饰的设计集是我和我同事一起设计并开发。',	'I worked in Misako as a junior designer since november 2010 for six months. I was working with another colleague to develop hangbags, belts and jewellery collections as pictures below. I designed clucht party hanbags made in fabric with special details ',	'https://defara.imgix.net/userdata/assets/content/2015/11/20/dace96ce17eb5b51bbeeb36b2bfec05c7e183344.png',	3,	'ACTIVE',	'',	'2015-11-20 06:33:06',	'2016-05-12 05:08:37',	NULL),
