(3,	41,	0,	'景贸服饰',	'Jingmao Apparel',	'景贸服饰是一家以开发、生产梭织女装为主的服装厂。工厂拥有完善的生产设备和技术力量、先进的管理模式和团结高效的服务团队。景贸生产出的产品手感好、做工精细，每一个和景贸合作过的客户都对其赞不绝口。\r\n景贸服饰虽然是一家新兴服饰厂，但它所交出的货品均体现了极高的性价比，让很多老牌服装工厂都不得不服。\r\n',	'Jingmao is a garment factory majoring in developing and producing women woven garment. The factory has perfect production equipment and technology, advanced management mode and efficient service. Products of Jingmao are well-made,feel good,and gained a lo',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/258a644bfe32b2d8ef381f737c2bf013ebc36386.jpg',	'聂启林',	'聂启林',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/a3e99f2687d9cd97d077b0d64f9f08241ca8c18f.jpg',	'',	'',	'86-153 9770 9007',	'15397709007@163.com',	50,	30,	0,	'9：00~18：00',	'',	'2012',	'',	NULL,	NULL,	538,	926,	929,	'[\"Jingmao\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/87a25e832c2662c2e7c097a0da942549212aa967.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(4,	44,	0,	'坤翔皮鞋',	'Kunxiang Leather Shoes',	'坤翔皮鞋厂成立于2008年，是一家集开发和生产时尚女鞋、女靴为一体的大型企业，工厂有先进的技术设备与科学的管理体系，这些都是优良产品的有力保证。\r\n以一家工厂的年龄来说，坤翔皮鞋厂确实很年轻。但它仅花了不到10年的时间，就已经成为了四川地区口碑最好的鞋工厂之一。可见，坤翔的品质和服务都是超一流的。在王老板的领导下，坤翔皮鞋厂从最开始的小小皮鞋工坊发展成了如今这个拥有2000平方米生产基地的皮鞋大厂，厂内有员工200多人。\r\n',	'Kunxiang leather shoes factory was founded in 2008, which is an enterprise designing and  producing  women’s shoes and boots. The factory  possesses advanced technology and equipment with scientific management system to guarantee high quality.\r\nKunxiang i',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/e2a5ff87f0c5c3fbf3781058e3122110a3fc6bab.jpg',	'王和荣',	'王和荣',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/9170d38ec4cb3ea49ad5fae07d137f24693871b0.jpg',	'',	'',	'86-134 0284 7872',	'405419954@qq.com',	200,	50,	0,	'9：00~18：00',	'',	'2008',	'',	NULL,	NULL,	538,	926,	929,	'[\"Kunxiang\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/a1fc6e907eae91c3aac980770f0a46d6a57cdb7f.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(5,	45,	0,	'雷剑健雅服饰',	'Leijianjianya Apparel',	'成都雷剑健雅服饰有限公司前身为中国人民解放军第九五一七工厂，企业占地面积98亩，厂房面积56649m²。公司拥有先进的CAD服装设计辅助系统、美国格柏公司的全自动裁床系统、加拿大衣拿公司智能悬挂生产系统和各种缝纫机设备。\r\n除了这些先进的现代化生产设备以外，雷剑健雅最引以为傲的还有始终如一的军人灵魂。诚信、严谨、坚韧……军人的优秀品质，在雷剑健雅公司随处可见。公司有近30年的军工服装生产历史，一直秉承着人民军队的优良传统，并凭借先进的管理、精良的设备、过硬的技术、卓越的产品质量和服务在军内外享有盛誉。\r\n',	'Leijianjianya Apparel has been the No. 9517 Factory of Chinese people\'s Liberation Army in former days, and now it covers the areas 98 Mu with 56649m² workshops.\r\nThe company possesses advanced CAD design supporting system, automatic cutting bed system fr',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/2acc07bdeb64d05b8e533e1dc534fdbbc530360a.jpg',	'黄文章',	'黄文章',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/01c1cbeaa64bfc247c0c293d38b6006f84b9084a.jpg',	'',	'',	'86-028-66652636',	'819305215@qq.com',	1100,	300,	0,	'9：00~18：00',	'',	'1985',	'',	NULL,	NULL,	538,	926,	929,	'[\"Ljjy\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/726459ba8319e9ecc2da5bb085be09277cce6cb1.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(6,	46,	0,	'米兰亚贝耳服饰',	'Milanyaber Apparel',	'米兰亚贝耳不同于传统意义上的服装工厂，它在十余载的风风雨雨中成长壮大，但依然保持着最初的那份对服装行业的赤诚之心。工厂的创始人——金老板希望把这家米兰亚贝耳打造成服装行业中的百年老店，因此，与时俱进的设备及技术、始终如一的赤子之心，两者缺一不可。\r\n米兰亚贝耳以深厚的文化积淀为基石，以设计、资讯、原材料来源、技术支持为强有力的后盾，凭借崭新的经营理念、稳健的步伐在市场中脱颖而出，现今已经被众多知名企业指定为定点生产厂家。',	'Milanyaber is different from those traditional garment factories.It grew in more than 10 years of ups and downs, but still preserves the sincere heart as the same as the beginning. Mr. Jin, the factory\'s founder, wants to make Milanyaber a clothing indust',	'gsdfg',	'gsdfgsd',	'https://defara.imgix.net/userdata/assets/profile/2016/02/26/1b8798cb7a9066b1b7e43347298accc6af92de5b.jpg',	'  金敏  ',	'  金敏  ',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/627e4d72ec296dc1c70c6dd8d17afb75ee955850.jpg',	'',	'',	'86-133 0800 3957',	'5814269@qq.com',	100,	100,	0,	'9：00~18：00',	'7',	'2016-05-27',	'fasdfas',	'',	'dsfasdfas',	538,	926,	929,	'[\"Shude\",\"Milanyaber\"]',	'[\"\",\"\"]',	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/c7932161de6dbeea43457732290f141e45d51f0e.jpg\"}',	'2016-04-12 04:49:05',	'2016-05-23 08:36:14',	NULL,	''),
(7,	47,	0,	'善延鞋业',	'Shanyan Shoes',	'善延鞋业是一家专业以生产加工时尚凉鞋、女鞋为主的工厂，工厂拥有完整、科学的质量管理体系。诚信，是善延鞋业一直坚守的准则；其产品所呈现的高质量也已经获得业界的认可。公司秉承“保证一流质量，保持一级信誉”的经营理念，坚持“客户第一”的原则，为国内外客户提供优质的服务。',	'Shanyan Footwear Factory is a professional factory producing fashion sandals and women shoes, which has a complete and scientific quality management system. Honesty, is the important principle of Shanyan Footwear Factory; the high quality of its products ',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/64c1bb29a2084c0610b36e03d978156f06eaeaea.jpg',	'徐宁',	'徐宁',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/3c6c987de4dade157e53aeac975218f5c2e4dd23.jpg',	'',	'',	'86-028-65140468',	'893100640@qq.com',	100,	50,	0,	'9：00~18：00',	'',	'2009',	'',	NULL,	NULL,	538,	926,	929,	'[\"Shanyan\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/ebdb0775b59c9d5cea818b7bc0444d822aaf0545.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(8,	48,	0,	'迎科制衣',	'Yingke Apparel',	'迎科创立于1998年，经过十多年的发展，工厂已经在西南制衣业界稳稳地占有了一席之地。多年来，迎科制衣坚持以市场为导向，生产适销对路的产品，同时以稳定的质量、良好的信誉、合理的价格，深受用户信赖。\r\n2015年6月，Defara产品团队参观了迎科工厂，厂内先进的制衣设备、员工一丝不苟的工作状态，让我们一下子就感受到了迎科严谨、认真的做事风格。我们与工厂的冯总进行深度交流，他十分热情的向我们介绍了工厂的设施和历史。\r\n2000年初，冯总把工厂搬进了新建的厂房和办公楼中，工厂摇身一变成了20000平方米的生产基',	'YINGKE was founded in 1998, and the factory has now occupied an important position in Southwest of China. Over the years, YINGKE insists offering marketable products, also with stable quality, reasonable price and good reputation.\r\nAt the beginning of 200',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/0c6d144440b32f41067cbeba37230e1e9afb6905.jpg',	'冯武',	'冯武',	'https://defara.imgix.net/userdata/assets/profile/2015/12/10/35fba4df94f916f24cb84a6408cd37d200256e06.jpg',	'',	'',	'86-028-4006-315-135',	'19909020@qq.com',	500,	50,	0,	'9：00~18：00',	'',	'1998',	'',	NULL,	NULL,	538,	926,	929,	'[\"YINGKE\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/84b1ffa95fe134e914f197e77cb5944eae22a3ed.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
