(20,	260,	0,	'巧奇皮具',	'Qiaoqi Bags',	'巧奇主营PU、真皮、进口真皮箱包，集设计、生产、质量控管于一体。公司创建于2001年，致力于国内高端PU、真皮皮具的创新研发，产品种类有手袋、手包、钱包、小皮件等多元化皮具产品。公司生产设备先进，同时拥有业内顶尖的设计研发团队、专业生产技术人员、工作经验丰富的600多名生产工人。巧奇坚持为客户设计、生产优质的皮具产品，并提供一系列细致、完善的售后服务。',	'Qiao Qi specializes in PU, leather and imported leather luggage. Founded in 2001, Qiaoqi committed to research and develop domestic high-end PU and leather goods. Products cover handbags, wallets, small leather goods and other diversified leather products',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/3b7e86cdaa87e7624c5b2ddc9fde6b302bdb97a1.jpg',	'任绪芬',	'任绪芬',	'https://defara.imgix.net/userdata/assets/profile/2015/12/17/75c550b83e01a779feb82baf7a1f938a5a4edc1f.jpg',	'',	'',	'86-020-86052252',	'215483996@qq.com',	150,	20,	0,	'8：00~18：00',	'',	'2001',	'',	NULL,	NULL,	538,	640,	644,	'[\"BeLLE\",\"BASTO\",\"C.banner\",\"YEARCON\",\"KANGNAI\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/10\\/aab6dece279c8f499a0631cf77c409c056b39f86.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
