(24,	278,	0,	'佳士特服饰',	'Jesita Apparel',	'佳仕特服饰有限公司成立于2001年,致力于高级西装定制及团体制服定制，主要生产包括西服套装、衬衫、大衣等各种服装产品。公司拥有专业的服装设计师、裁剪师，配套设施齐全。自成立以来，佳仕特一直以“质量上乘，工艺精细，细节铸造完美，提供客户所需”为经营宗旨，将客户的满意视为最大的收获。佳仕特秉承着一贯稳健的企业经营作风，以其精湛的工艺、优良的质量赢得了消费者的认可，积累了丰富的生产和服务经验，一步一脚印地在激烈的市场竞争中成长。',	'Jesita Clothing Limited Liability Co.Ltd was established in 2001. It is committed to customization of advanced suit and team uniforms, the main productions including suits, shirts, coats and other clothing products. The company has professional designers,',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/18a44f2208b3345c26f54893928a596eeac3401c.jpg',	'李建辉',	'李建辉',	'https://defara.imgix.net/userdata/assets/profile/2015/12/18/ead044c262429757a14a1791e5507fd7e5743391.jpg',	'',	'',	'86-028-86114666, 86-15884533549',	'237594916@qq.com',	100,	1,	0,	'9:00~19:00',	'',	'2012',	'',	NULL,	NULL,	538,	926,	929,	'[\"JESITA\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/18\\/fc3b75269b6ab80b23649957f8dd7a12c9b9737c.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(25,	282,	0,	'姿绒华羽羊毛衫编织',	'Zroyal knitwear',	'成都姿绒•华羽是一家集纱线供给，高品质羊绒衫、羊毛衫研发、设计、生产为一体的综合性服务企业。作为中国大西南片区首家编织订制综合性服务企业，姿绒•华羽销售网络覆盖全国，同时提供高端时尚羊毛衫、羊绒衫的大批量订制服务。姿绒•华羽的产品不仅受到国内客户的认可，还远销欧美，得到国际客户的好评。姿绒•华羽坚持精品战略，以优质的产品和服务，赢得了客户的首肯。公司拥有德国进口STOLL电脑横机、日本进口绣花机，以及达到出口服装洗缩、熨烫后整理要求的专业设备和技术。',	'ZROYAL has the capacity to design and manufacture yarn distribution, wool and cashmere products, providing unique customized service and bulk production correspondent to worldwide clients. Its distribution system and sales network is nationally establishe',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/05/7dfbabfdf1587093a8b1f6f73da91b621b066859.jpg',	'刘纯义',	'刘纯义',	'https://defara.imgix.net/userdata/assets/profile/2015/12/28/3f6fb23a2e544700baa0c6d3b1023f58a082f5eb.jpg',	'',	'',	'86-13550036271',	'2420430950@qq.com',	100,	1,	0,	NULL,	'',	'1985',	'',	NULL,	NULL,	538,	926,	929,	'[\"ZROYAL\"]',	NULL,	'{\"wechat_no\":null,\"top_picture\":\"https:\\/\\/defara.imgix.net\\/userdata\\/assets\\/profile\\/2015\\/12\\/28\\/0aab1353b416613243f9da5a37a46fd550d88b54.jpg\"}',	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(26,	283,	0,	'乔荻五金饰品',	'Qiaodi Jewelry',	'乔荻五金饰品厂是一家专业生产五金饰品的企业，主营业务为设计并生产钛、钢、钨钢等材质的首饰，产品远销欧美。本着“客户第一，诚信至上”的经营原则，乔荻与海外多家知名企业建立了长期的合作关系。乔荻拥有先进而专业的五金首饰生产设备，并且引进了一大批优秀的首饰设计人才。凭借着精湛的工艺、卓越的产品品质和细致入微的服务，乔荻赢得了客户的一致好评和支持。在未来的日子里，乔荻依然坚持不断创新，不断开拓新的市场，致力于成为深受客户信赖的一流饰品供应商。',	'QiaoDi Hardware Jewelry Factory is specialized in the production of hardware jewelry business, the main business is designing and producing jewelry of titanium, steel, tungsten steel and other materials. Its products are exported to Europe and America. Qi',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/12/679e41ad31b1d7e13f88751939173eb21121d237.jpg',	'薛桓',	'薛桓',	'https://defara.imgix.net/userdata/assets/profile/2016/01/12/df2a56c7b10548496ed906421cb72749a8587cd3.jpg',	'',	'',	'86-13926565353',	'Look_out@163.com',	60,	100,	0,	NULL,	'',	'2009',	'',	NULL,	NULL,	538,	640,	642,	'[\"QiaoDi\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(27,	284,	0,	'塞飞洛皮具',	'CEFIRO',	'塞飞洛皮具有限公司致力于研发休闲、时尚、个性化的皮具产品。在“中国皮具之都”狮岭镇，塞飞洛是拥有自主品牌、规模最大、生产能力最强的皮具公司之一。通过大力引进各类优秀专业人才和国际先进的皮具生产设备，塞飞洛的品牌影响力和市场占有率迅速扩大。除了中国本土，塞飞洛还将目光投向海外，积极拓展国际市场。如今，塞飞洛产品已远销至欧洲、美洲、东南亚等地区，在意大利、波兰、俄罗斯、越南、巴西、墨西哥等国建立了稳固的销售网络。',	'CEFIRO is committed to the development of leisure, fashionable, personalized leather products. CEFIRO owns its own brand, and is one of the largest leather goods companies in \"China\'s leather capital\" Shiling Town. By vigorously introducing outstanding pr',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/12/14adce63c1a26e19431cb6e7930021c988c321a8.jpg',	'金春义',	'金春义',	'https://defara.imgix.net/userdata/assets/profile/2016/01/12/35c87b01a4afec95a92f76f0b4011940537a1d5c.jpg',	'',	'',	'86-020-86990033',	'13868682328@qq.com',	300,	100,	0,	'9：00~21：00',	'',	'1997',	'',	NULL,	NULL,	538,	640,	644,	'[\"CEFIRO\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
