(30,	298,	0,	'东梵服装',	'Dongfan Apparel',	'东梵服装厂是一间专业生产加工中高档内外贸女装、童装的私营独资企业。工厂拥有一批优秀的设计人员和裁剪师，以及先进的生产设备、生产作业员，能严格把控产品质量和出货时间。 \r\n公司拥有完整、科学的质量管理体系，并致力于通过互联网平台，全面整合广东地区服装资源，减少流通环节，为全国各地服装批发、零售商提供物美价廉的服装货源。 \r\n东梵承接国内外一线服装品牌的OEM、ODM业务，同时获得了香港优秀服装品牌---FASVGO梵森菲格在大陆的独家运营权。\r\n',	'Dongfan Apparel was established in 2007, specializing in the wholesale of ladies\' garments. Being familiar with apparel purchase of Guangdong market. Dongfan Apparel can find good channels for a variety of high-quality products at low costs and have estab',	NULL,	NULL,	'https://defara.imgix.net/userdata/assets/profile/2016/01/25/d42d7789a9ec48f0cc6cada48cd6fd16348eaf4a.jpg',	'李令竞',	'李令竞',	'https://defara.imgix.net/userdata/assets/profile/2016/01/25/319d968f0722fa97bc89ba6decd2f39283e0c3cf.jpg',	'',	'',	'0755-85005055，13025123403',	NULL,	100,	300,	0,	'8：00-18：00',	'',	'2006',	'',	NULL,	NULL,	538,	640,	644,	'[\"Ousili\"]',	NULL,	NULL,	'2016-04-12 04:49:05',	'2016-04-12 04:49:19',	NULL,	NULL),
(31,	299,	0,	'欧歌妮制衣',	'Ougeni Apparel',	'欧歌妮制衣厂致力于设计、生产、批发多种品类的男女士精品服装。公司与国内外多家零售商、代理商建立了长期稳定的合作关系，在客户中享有美誉。欧歌妮建厂时间不长，但已凭借雄厚的实力、诚信优质的服务，赢得了广大客户的信任。',	'Ougeni Apparel is dedicated to design, produce and wholesale a variety of categories of men’s and women’s boutique clothing. The company has established a stable long-term cooperative relation with domestic and foreign retailers and agents, and enjoys a g',	'撒大多数',	'发送到发送到',	'https://defara.imgix.net/userdata/assets/profile/2016/01/27/98895b9f6e4e0bba134c01582afee787ef22249a.jpg',	'蔡树坤',	'蔡树坤',	'https://defara.imgix.net/userdata/assets/profile/2016/01/27/6a188114cc9f7602e22e1f3e8ec62c48a7b07840.jpg',	'',	'',	'86-020-34397673',	'YBF2@VIP.qq.com',	10000,	5000,	0,	'9:00-23:00',	'7.5',	'2016-04-22',	'1',	'',	'法师打发斯蒂芬45根据公开价格会尽快更换即可更换件',	538,	640,	644,	'[\"Bainiaohuazi\",\"R\\uff0eJstory\"]',	'[\"\",\"\"]',	NULL,	'2016-04-12 04:49:05',	'2016-05-23 10:22:18',	NULL,	''),
