(1,	3,	NULL,	'',	'灯光下，年轻的景贸匠人正专注于手中的缝制工作。',	'',	'https://defara.imgix.net/userdata/assets/profile/2015/09/01/d7c83c7d20865c046806fbe2162e0c3f8287d2de.jpg',	'CRAFT',	'2015-09-01 10:08:45',	'2015-09-01 10:08:45',	NULL),
(2,	3,	NULL,	'',	'力求每一针都完美，每一线都优美，这已经成了景贸缝制流程中默认的准则。',	'',	'https://defara.imgix.net/userdata/assets/profile/2015/09/01/f7746d1a628b8b0b229117b01c1ad3895829c639.jpg',	'CRAFT',	'2015-09-01 10:09:13',	'2015-09-01 10:09:13',	NULL),
(3,	3,	NULL,	'',	'每天，看着等待熨烫的产品最终变为熨烫完毕的优质成衣，这是最让工作台的小张欣慰的事。',	'',	'https://defara.imgix.net/userdata/assets/profile/2015/09/01/d4dce3901e5869a99a723869782697a9da4ef941.jpg',	'CRAFT',	'2015-09-01 10:09:26',	'2015-09-01 10:09:26',	NULL),
(4,	3,	NULL,	'',	'除了优秀的匠人，这些陪伴匠人多年的机器，身上也蕴藏了太多太多难忘的制衣故事。',	'',	'https://defara.imgix.net/userdata/assets/profile/2015/09/01/7e5958b9c0b393f2e01adfacb75140a3ae766a11.jpg',	'CRAFT',	'2015-09-01 10:10:19',	'2015-09-01 10:10:19',	NULL),
