(28,	'notice',	'authentication.maker.pending',	'我们已收到你的认证申请，正在审核表单信息。缝纫侠商务代表会尽快联系你，进行实地验厂。请耐心等待，谢谢！',	'We have successfully received your information sheet, and are verifying the information.DEFARA business representative will contact with you as soon as possible.Please wait patiently.Thanks you!',	'认证信息审核中',	'Signing up succeeded and pending approval ',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(29,	'notice',	'authentication.designer.pending',	'我们已收到你的认证申请，会在7天内完成表单信息审核。审核通过后，你将拥有个人主页，设计师账户将被激活；若审核不通过，我们也会及时告知审核结果，你仍然可以完善信息，重新申请认证。请耐心等待，谢谢！',	'We have successfully received your information sheet.Your personal showroom will be displayed once your account is successfully verified in 7 days. We will keep you updated if we think your information sheet needs to be improved during the verification process.',	'认证信息审核中',	'Signing up succeeded and pending approval ',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(30,	'notice',	'authentication.designer.finish',	'祝贺你！你已通过缝纫侠设计师审核认证！你的设计师账户已激活，个人主页已准备就绪。你现在就可以登录缝纫侠，开始你的在线时尚事业。进一步完善你的个人信息，上传设计作品和设计服务，马上就能吸引成千上万时尚创客和制造商的目光！',	'Congratulation! The information you provide has met our requirements and ready to be shown to billions of buyers and manufacturers.Now you can log in DEFARA with your account and password to improve and complete your settings. You could update your profile and upload design services to make your showroom more attractive to buyers and manufacturers.',	'你已成为缝纫侠认证设计师',	'You have become DEFARA verified designer',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(31,	'notice',	'authentication.designer.refuse',	'非常遗憾……你没有通过缝纫侠认证设计师审核。请按照以下提示，进一步完善认证信息，重新申请认证: 1. 提供你的照片作为个人头像，并上传曾经的设计作品。2. 尽可能详细地填写你的教育、工作及其他履历信息。3. 确保你提供的信息真实有效。',	'Your information sheet is not approved in the verification process.Please improve your information sheet to meet our requirements.1.Provide actual photo as headshot and upload your works are important.2.Fill in your career, education and other personal information as much as possible3.Make sure the information you provided are authentic.',	'抱歉！你需要继续完善认证信息',	'Oops!Your information needs to be further improved',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(32,	'notice',	'service.designer.pending_pay',	'你收到一个新订单，点击查看详情。订单号: :id 名称: :name',	'You have a new order, please check the details.Order Number: :id Product Name: :en_name ',	'你收到一个新订单',	'You have a new order',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(33,	'notice',	'service.pending_pay',	'请尽快完成支付。如果超过24小时未付款，系统将自动取消该订单。订单号: :id 名称: :name',	'Please complete payment process in time.The order will be canceled automatically if you do not pay off in 24 hours.Order Number: :id Product Name: :en_name ',	'你有一笔订单待付款',	'Your order is waiting payment',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(34,	'notice',	'service.draft_submitted',	'设计师 :designer_name 已向你发送最新初稿，请尽快查收。订单号: :id 名称: :name ',	'DEFARA Designer :designer_name has sent your a sketch.Please check it as soon as possible.Order Number: :id Product Name: :en_name ',	'你收到了设计初稿',	'You received a sketch',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(35,	'notice',	'service.submitted',	'设计师 :designer_name 已向你发送终稿，请尽快确认稿件。如果3天内未确认，系统默认将总额 ¥:amount 付至设计师 :designer_name 的DEFARA账户订单号: :id 名称: :name',	'DEFARA Designer :designer_name has sent your a Tech Pack.Please check it as soon as possible.The total payment ¥:amount will be paid for DEFARA Designer :designer_name if your do not confirm receipt within 3 days.Order Number: :id Product Name: :name ',	'你收到了设计终稿',	'You received a Tech Pack',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(36,	'notice',	'service.expired',	'订单号: :id已超过有效期，该订单已自动取消。订单号: :id 名称: :name',	'Your order: :id has exceeded the time limit, and been canceled automatically.Order Number: :id Product Name: :en_name ',	'你有一笔订单已过期',	'Your order exceeded the time limit',	'2016-05-26 10:35:46',	'2016-05-26 10:35:46'),
(37,	'notice',	'withdraw.successed',	'你的提现申请已通过审核！¥:amount :card 流水号: :number',	'Your withdrawal submission is approval!¥ :amount :en_card.Serial Number: :number ',	'提现成功',	'Withdrawal Succeeded',	'2016-05-26 10:35:47',	'2016-05-26 10:35:47'),
(38,	'notice',	'withdraw.failed',	'抱歉，DEFARA认为你的提现申请不符合平台提现规则，因此未予通过。具体原因如下: :content',	'Sorry, your withdrawal submission did not meet DEFARA withdrawal policy and has not been approval. The detailed reason is: :en_content',	'提现失败',	'Withdrawal failed',	'2016-05-26 10:35:47',	'2016-05-26 10:35:47');
